#include "boost/tokenizer.hpp"
#include "boost/algorithm/string.hpp"
#include "boost/algorithm/string/predicate.hpp"

std::string trim(std::string rawStr)
{
    boost::trim(rawStr);
    std::string strResult(rawStr.c_str());
    return ( strResult );
}

ACE_CString trim_ACE(ACE_CString rawStr)
{
    std::string strStl(rawStr.c_str());
    strStl = trim(strStl);
    ACE_CString strACE(strStl.c_str());
    return ( strACE );
}

std::vector<std::string> tokenize(std::string strRaw, std::string strDelimiter)
{
    std::vector < std::string > vTokens;
    typedef boost::tokenizer<boost::char_separator<char> > tokenizer;
    boost::char_separator<char> seperator(strDelimiter.c_str());
    tokenizer tokens(strRaw, seperator);
    for ( tokenizer::iterator tok_iter = tokens.begin() ; tok_iter != tokens.end() ; ++tok_iter )
    {
        std::string strToken = std::string(*tok_iter);
        vTokens.push_back(strToken);
    }
    return ( vTokens );

}

std::string getTimestamp()
{
    char buffer[32];
    ::memset(&buffer, 0, sizeof ( buffer ));
    struct tm stTm;
    ::memset(&stTm, 0, sizeof(struct tm));
    time_t currentTime = time(NULL);
    ::localtime_r(&currentTime, &stTm);
    ::strftime(buffer, sizeof ( buffer ), "%Y%m%d_%H%M%S", &stTm);
    std::string strTimestamp(buffer);
    return ( strTimestamp );
}

std::string getTimestamp(time_t utc)
{
    char buffer[32];
    ::memset(&buffer, 0, sizeof ( buffer ));
    struct tm stTm;
    ::memset(&stTm, 0, sizeof(struct tm));
    ::localtime_r(&utc, &stTm);
    ::strftime(buffer, sizeof ( buffer ), "%Y%m%d_%H%M%S", &stTm);
    std::string strTimestamp(buffer);
    return ( strTimestamp );
}

time_t changeTimestampToUTC(std::string strTimestamp)
{
    // YYYYMMDDHHMISS => UTC
    strTimestamp = trim(strTimestamp);
    time_t timeTarget;

    if ( strTimestamp.length() == 14 )
    {
        struct tm tmTime;
        ::memset(&tmTime, 0, sizeof(struct tm));
        tmTime.tm_year = atoi(strTimestamp.substr(0, 4).c_str()) - 1900;
        tmTime.tm_mon = atoi(strTimestamp.substr(4, 2).c_str()) - 1;
        tmTime.tm_mday = atoi(strTimestamp.substr(6, 2).c_str());
        tmTime.tm_hour = atoi(strTimestamp.substr(8, 2).c_str());
        tmTime.tm_min = atoi(strTimestamp.substr(10, 2).c_str());
        tmTime.tm_sec = atoi(strTimestamp.substr(12, 2).c_str());
        timeTarget = ::mktime(&tmTime);
    }
    else
    {
        timeTarget = 0;
    }
    return ( timeTarget );
}

ACE_CString getDoubleString(ACE_CString raw, double multiple, double defaultValueIfNull)
{

    raw = trim_ACE(raw);
    double composite_rate = 0;
    try
    {
        if ( raw != "" )
        {
            composite_rate = ::atof(raw.c_str());
            if ( multiple != 0 )
            {
                composite_rate = composite_rate / multiple;
            }
        }
    }
    catch ( std::exception e )
    {
        composite_rate = defaultValueIfNull;
    }

//    std::ostringstream os;
//    os << composite_rate;

    char buf[128];
    ::memset(&buf, 0, sizeof ( buf ));
    ::sprintf(buf, "%.6f", composite_rate);

    ACE_CString result(buf);
    result = trim_ACE(result);
    return ( result );
}

double parseDouble(ACE_CString raw, double defaultValue)
{
    raw = trim_ACE(raw);
    double result = 0;
    if ( raw == "" )
    {
        result = defaultValue;
    }
    else
    {
        try
        {
            result = ::atof(raw.c_str());
        }
        catch ( std::exception e )
        {
            result = defaultValue;
        }
    }
    return ( result );

}

int parseInt(ACE_CString raw, int defaultValue)
{
    raw = trim_ACE(raw);
    int result = 0;
    if ( raw == "" )
    {
        result = defaultValue;
    }
    else
    {
        try
        {
            result = ::atoi(raw.c_str());
        }
        catch ( std::exception e )
        {
            result = defaultValue;
        }
    }
    return ( result );
}

